INSERT INTO `page__page_translations` VALUES (1,1,'en','Welcome','welcome','1','<p>We are currently the process of developing a lot of interesting projects both software and hardware, the first being this new site. We intend to release this as a framework for other radio amateurs to build great web sites</p>\n\n<p>This frame work will make it very simple to make a high quality website in record time using supplied templates or you can design your own.</p>\n\n<p>We are making the process a simple as possible, but more on this later through our blog. Focusing on digital modes and software including VOIP with many years of experience in both this and the software development field.</p>\n\n<p>The new online logbook is now available using the menu above,&nbsp; this displays what is possible using low power, as you will see long distance communications are possible with quite low power and a modist antenna system. All of the contacts were made using a max power of 15 watts of FT8 from the Xeigu G90 into a multi band vertical antenna / wjstx and custom flrig combination.</p>\n\n<p>The log solution we are using is novel it does highlight what is possible with simple software solutions when you pick the right tools, we have re-developed the logbook solution now and are using a custom UDP based Bridge to log directly into DigiQRP.&nbsp;</p>\n\n<p>This now also has callsign location lookup as well, as the contact is uploaded to the system it looks up the callsign and recovers location details for the contact made. The look and feel of the layout has been updated too with the qso end date and time held in separate columns, it important to understand that this is a live log, contacts are posted as they are made.</p>\n\n<p>Our news feed will also go live this month so that you can have an RSS feed direct to your device.</p>\n\n<p>Mark G4LCH</p>','Home page',NULL,NULL,NULL,NULL,NULL,'2021-04-11 05:29:04','2021-04-11 11:44:35'),(3,3,'en','Downloads','downloads','1','<p>Downloads are will be divided into two areas:</p>\n\n<ul>\n	<li>Public&nbsp;</li>\n	<li>Private</li>\n</ul>\n\n<p><strong>Public Downloads</strong></p>\n\n<p>These are general downloads that can be tools and full applicatons that we support.</p>\n\n<p><strong>Private Downloads</strong></p>\n\n<p>These are very specific downloads only available to our members these this includes any of the templates and the framework we are working on at the moment.</p>\n\n<p>Downloads are will be divided into two areas:</p>\n\n<ul>\n	<li>Public&nbsp;</li>\n	<li>Private</li>\n</ul>\n\n<p><strong>Public Downloads</strong></p>\n\n<p>These are general downloads that can be tools and full applicatons that we support.</p>\n\n<p><strong>Private Downloads</strong></p>\n\n<p>These are very specific downloads only available to our members these this includes any of the templates and the framework we are working on at the moment.</p>',NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-12 06:16:12','2021-04-12 10:14:41'),(4,4,'en','Registration','registration','1','<p>The system registratioin system will open soon, this will provide some neat feautures such as a forum, private downloads and messages.</p>\n\n<p><strong>Messaging</strong></p>\n\n<p>This will permit you to message other members directly and the systems administrators / developers for assistance, build groups focused on your specfic needs or the needs of your group.</p>\n\n<p><strong>Forum</strong></p>\n\n<p>This is the most iinteresting development and will not be an easy task, we are not going. to provide just any old forum but one modeled on Lotus Notes and Domino with replication, anyone who has ever worked with this software understands the true power of this schema.&nbsp; In short this will allow you to not only syncronise your documents, responses and their responses but also achive this at a site level so that multiple sites can replicate a specific subset of data to their own system and publish this in their own right.</p>\n\n<p>We have not seen any other system attempt this bold task to date buut having worked for Lotus Development Corporation we have a real insight into how to do this properly.</p>\n\n<p>This will act as a sub system under the control of a web server / network stack.&nbsp;</p>',NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-12 06:16:45','2021-04-12 10:13:52'),(6,6,'en','logbook','logbook','1','<h3>Current Digital Mode Log Entries</h3>\n\n<p>These are live multi-band low power ( max 10 watts ) logbook entries for G4LCH using Xeigu G90 and multi-band vertical.</p>',NULL,NULL,NULL,NULL,NULL,NULL,'2021-04-12 10:26:02','2021-04-12 10:26:27');
